import React, { Component } from "react";
import Items from "./Items";
class App extends Component {
  state = {
    items: [
      { content: "tomato", id: 1 },
      { content: "cheese", id: 2 },
    ],
  };
  render() {
    return (
      <div className="App">
        <h1> Shopping List</h1>
        <Items items={this.state.items} />
      </div>
    );
  }
}

export default App;
